window.bookSummaryJSON = "<p>Nancy Warren presents Books 4-6 in the Vampire Knitting Club series.</p> <p>Lucy Swift's adventures continue in Oxford, England, as she still struggles to knit, tries to make sense of her witch powers, and manage the late night vampire knitting club with her neighbors who live beneath her knitting shop. When murder comes calling, though, her undead, nosy neighbors are only too willing to help this amateur sleuth solve the case.</p>"; 
